    background-size: 1000px 100px;


}

footer .wave#wave1
{

    z-index: 1000;
    opacity: 1;
    bottom: 0;
    animation: animateWave 9s linear infinite;
}

footer .wave#wave2
{
    z-index: 999;
    opacity: 0.5;
    bottom: 10px;
    animation: animateWave_02 8s linear infinite;
}

footer .wave#wave3
{
    z-index: 1000;
    opacity: 0.2;
