}

footer .wave#wave4
{
    z-index: 1000;
    opacity: 0.7;
    bottom: 20px;
    animation: animateWave_02 14s linear infinite;
}


@keyframes animateWave
{
    0%
    {
        background-position-x: 1000px;
    }
    0%
    {
        background-position-x: 0px;
    }
}

@keyframes animateWave_02
{
    0%
    {
        background-position-x: 0px;
    }
    0%
    {
        background-position-x: 1000px;
    }
}

