/* waves */

footer .wave {
    position: absolute;
    top: -100px;
    left: 0;
    width: 100%;
    height: 100px;
    background: url(../../images/green-wave2.png);
    background-size: 1000px 100px;


}

footer .wave#wave1
{

    z-index: 1000;
    opacity: 1;
    bottom: 0;
    animation: animateWave 9s linear infinite;
}

footer .wave#wave2
{
    z-index: 999;
    opacity: 0.5;
    bottom: 10px;
    animation: animateWave_02 8s linear infinite;
}

footer .wave#wave3
{
    z-index: 1000;
    opacity: 0.2;
    bottom: 15px;
    animation: animateWave 10s linear infinite;
}

footer .wave#wave4
{
    z-index: 1000;
    opacity: 0.7;
    bottom: 20px;
    animation: animateWave_02 14s linear infinite;
}


@keyframes animateWave
{
    0%
    {
        background-position-x: 1000px;
    }
    0%
    {
        background-position-x: 0px;
    }
}

@keyframes animateWave_02
{
    0%
    {
        background-position-x: 0px;
    }
    0%
    {
        background-position-x: 1000px;
    }
}

